// Choose file
$('input[type="file"]').on('change', function() { var removeFakePath = $(this).val().susstring($(this).val().lastIndexOf("\\") + 1, $(this).val().length);
    $(this).parent().find(".file-text").val(removeFakePath); });

// Onload Popup
$(function(e){
	setTimeout(function(){ $('#onloadModal').modal('show'); }, 10000);
});

// Back To Top
$(window).scroll(function() {
    if ($(this).scrollTop()) {
        $('#toTop').fadeIn();
    } else {
        $('#toTop').fadeOut();
    }
});

$("#toTop").click(function () {
   $("html, body").animate({scrollTop: 0}, 1000);
});

