$(document).ready(function(){
    $(function(e){
        $("body").on("click",".nav.navbar-nav .parent .dropTogg", function(e){
            e.preventDefault();
            e.stopPropagation();
            $(this).addClass("open");
            $(this).parent().parent().find(".child").eq(0).addClass("open");
        });
        $("body").on("click",".nav.navbar-nav .parent .dropTogg.open", function(e){
            e.preventDefault();
            e.stopPropagation();
            $(this).removeClass("open");
            $(this).parent().parent().find(".child").removeClass("open");
            $(this).parent().parent().find(".dropTogg").removeClass("open");
        });
    });
});